mapping.turtle:
bf:contribution [ a bf:Contribution ;
   bf:agent <value> ] .
# with literal value
bf:contribution [ a bf:Contribution ;
   bf:agent [ a bf:Agent ;
      rdfs:label "value" ] ] .

bf:note [ a bf:Note ;
   rdfs:label "value" ;
   bf:noteType "University of Washington note" ] .

bf:classification [ a bf:Classification ;
   rdf:value "value" ;
   bf:source [ a bf:Source ;
      rdfs:label "Library of Congress Geographic Classification" ] ] .
